import React from 'react';
import './App.css';

const Chessboard = () => {
  const renderSquare = (isBlack, key) => {
    const color = isBlack ? 'black' : 'white';
    return <div key={key} className={`square ${color}`}></div>;
  };

  const renderRow = (startWithBlack, rowIndex) => {
    const squares = [];
    for (let i = 0; i < 8; i++) {
      squares.push(renderSquare((startWithBlack + i) % 2 === 0, i));
    }
    return <div key={rowIndex} className="board-row">{squares}</div>;
  };

  const renderBoard = () => {
    const rows = [];
    for (let i = 0; i < 8; i++) {
      rows.push(renderRow(i % 2 === 0, i));
    }
    return <div className="chessboard">{rows}</div>;
  };

  return <div className="chessboard-container">{renderBoard()}</div>;
};

function App() {
  return (
    <div className="App">
      <Chessboard />
    </div>
  );
}

export default App;
